import React, { Fragment } from 'react';
import classes from "./styles/login.module.css"
import AuthImage from "../../reusables/AuthImages";
import Card from '../../UI/card/Card';
// import img from "../../../../src/assests/images/istockphoto-1421053049-612x612.jpg";

const Login =() => {

    // const myStyle={
    //     // backgroundImage: `url(${img})` ,
    //     height:'100vh',
    //     // marginTop:'-70px',
    //     // marginBottom: "-70px",
    //     margin: "-56px",
    //     fontSize:'50px',
    //     backgroundSize: 'cover',
    //     backgroundRepeat: 'no-repeat',
    // };

  return (
    <Card>
      <div className="interface">
        <div>
          <AuthImage />
        </div>

        <div className={classes.division}>
          <form action="">
            <label htmlFor="" style={{ marginTop: "30px" }}>
              SubjectID:{" "}
            </label>
            <br></br>
            <input type="text" name="" className={classes.input} />
            <br></br>

            <label htmlFor="">Password: </label>
            <br></br>
            <input type="password" name="" className={classes.input} />
            <br></br>

            <br></br>
            <input
              align="right"
              type="button"
              color="blue"
              value="Login"
              className={classes.loginsign}
            />
          </form>
        </div>
      </div>
    </Card>
  );
}


export default Login;
